#################### <- VARIABLES ->##################################

$desktop = [Environment]::GetFolderPath("Desktop")
$IconPath = "$env:TEMP\shortcut-picture.ico"


### --- Shortcut Information --- ###
    #Link to site here
$shortcut_target = ""

$shortcut_location = "$desktop\Sharepoint.url"
    # Convert .ico file here https://base64.guru/converter/encode/image/ico / Sharepoint icon currently
$IconBase64 = ""

######################################################################


# - Coverts Base64 to .ico file - #
[byte[]]$Bytes = [convert]::FromBase64String($IconBase64)
[System.IO.File]::WriteAllBytes($IconPath,$Bytes)

# - Creates shortcut file - #
$WshShell = New-Object -COMObject WScript.Shell
$Shortcut = $WshShell.CreateShortcut($shortcut_location)
$Shortcut.TargetPath = $shortcut_target
$Shortcut.Save()

# - Adds shortcut icon to file config - #
'IconIndex=0', "IconFile=$IconPath" |
  Add-Content -LiteralPath $shortcut_location


# - Clear up - #
Remove-item $iconPath
